import React from 'react';
import './LeftMenu.css';

class LeftMenu extends React.Component {

  render() {
    return (
      <div className="menu left">
        <div className="banner">
          Menu
        </div>
        <div className="elements">
          <div className="element">
            element 1
          </div>
          <div className="element">
            element 2
          </div>
          <div className="element">
            element 3
          </div>
        </div>
      </div>
    )
  }

  
}

export default LeftMenu;
